import React, { Component } from 'react';
import Buttons from './Buttons.js';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      details:[
        {id:'home', label:'Home'},
        {id:'about', label:'About'},
        {id:'projects', label:'Projects'},
      ]
    }
  }

  render() {

    return (
      <div className="App">
        <div className='main'>
          <Buttons info={this.state.details}/>
          <MainInfo info={this.state.details}/>
        </div>
      </div>
    );
  }
}

class MainInfo extends Component{


  render() {
    return(
      <div>
        <article className='home-div'>
          <h1>Name Lastname</h1>
          Landing page
        </article>
        <article className='about-div'>
          <h1>About</h1>
          Basic information
        </article>
        <article className='about-div'>
          <h1>Projects</h1>
          Github links
        </article>
      </div>
    )
  }
}


export default App;
